import React from "react";
import ExpenseItem from './ExpenseItem';

const Expenses = (props) => {
  return (
    <div>
      <ExpenseItem text={props.items[0].text} />
      <ExpenseItem text={props.items[1].text} />
      {props.items.map(expense => <ExpenseItem text = {expense.text}/>)}
    </div>
  );
};

export default Expenses;
